// HEADER TEMPLATE

import './css/header.css'
import Navbar from './Navbar.js'



function Header()
{
    return(
        <>
            
            <nav className="navbar navbar-expand-lg w-100 nav_bg p-0">
                <div className="container-fluid">
                
                <a href="#" className="mx-auto me-5"> <i className="fa-solid fa-meteor mx-auto logo"></i> </a>

                <button className="navbar-toggler" type="button" data-bs-toggle="offcanvas" data-bs-target="#nav_toggler" style={{"order": -1}}>
                    <i onclick="openNav()" className="fa-solid fa-bars-staggered nav_togg"></i>
                </button>

{/* ----------------------------------------------------------------- */}

                    <Navbar></Navbar>

{/* ----------------------------------------------------------------- */}

                <i title="PROFILE" className="fa-regular fa-user icons"></i>
                <i title="CART" className="fa-solid fa-cart-shopping icons"></i>
                
                </div>
            </nav>

        </>
    )
}

export default Header;
